import React from "react";
import { Text, StyleSheet, View, TextInput } from "react-native";

const InputText = () => {

    return( 
    
    <View>
        <TextInput 
        style = {styles.input}
        autoCapitalize = "none"
        autoCorrect = {false}
        />
        <Text>Your name is</Text>
    </View>
    
    );


};

const styles = StyleSheet.create({

    input: {

        margin: 15,
        borderColor: 'black',
        borderWidth: 1
    }

}) ;


export default InputText;
